window.bookSummaryJSON = "<p>My Fake Gargoyle Fiancé</p> <p>So, this is rock bottom. Not only did I lose my job and my apartment, but now, an ultra-secret snow leopard shifter group wants me to marry a guy I never met and have babies to save our species. And they’re coming in three days to take me away.</p> <p>Cue me getting smashed alone on a Thursday night. That is until the world’s sexiest, brooding stranger walks in, all sharp angles and hard lines. He’s massive and covered in muscles, and his mesmerizing green-gray eyes has my knees turning to jelly. In a moment of brilliance—or perhaps it was the gin and tonic—I ask him to marry me.</p> <p>I wake up in Gunnar Redrock’s luxurious penthouse suite. It’s supposed to be a charade, but the line between fact and fiction gets blurrier the more time I spend with him. Our marriage may be a sham, but these feelings are the real deal.</p> <p>Stuck between a rock and a hard place, the only way forward might land me with a broken heart.</p> <p>Rock and a Hard Place is a standalone paranormal romance full of sweet &amp; steamy scenes with a protective bad-boy gargoyle. HEA guaranteed.</p>"; 
